def my_func(input1: str, input2: str):
    output1 = 0
    output2 = 0

    # To keep track of characters we've matched for output1
    matched_input1 = [False] * len(input1)
    matched_input2 = [False] * len(input2)

    # First pass to count characters at the same position (output2)
    for i in range(len(input1)):
        if input1[i] == input2[i]:
            output2 += 1
            matched_input1[i] = True
            matched_input2[i] = True

    # Second pass to count characters at different positions (output1)
    for i in range(len(input1)):
        if not matched_input1[i]:
            for j in range(len(input2)):
                if not matched_input2[j] and input1[i] == input2[j]:
                    output1 += 1
                    matched_input2[j] = True
                    break

    return output1, output2

def my_func(input1, input2):
    # Initialize counters
    output1 = 0
    output2 = 0

    # Convert input strings to lists for easier manipulation
    list1 = list(input1)
    list2 = list(input2)

    # Create dictionaries to count characters
    count1 = {char: list1.count(char) for char in set(list1)}
    count2 = {char: list2.count(char) for char in set(list2)}

    # Check for perfect matches (output2)
    for i in range(4):
        if list1[i] == list2[i]:
            output2 += 1
            # Remove matched characters to avoid double counting
            count1[list1[i]] -= 1
            count2[list2[i]] -= 1

    # Check for misplaced matches (output1)
    for char in count1:
        if char in count2:
            output1 += min(count1[char], count2[char])

    return output1, output2
